window.bookSummaryJSON = "<p>Andross Silver’s secret has been revealed to the world. An eighth Marked one, born before his predecessor has passed away.</p> <p>Peace and destruction have fluctuated with the appearance of every new Divine, causing humanity to tense, and strain, but never to break. Andross, however, is a new factor. One that others fear can shatter that balance. Unprecedented, his presence heralds chaos and begets destruction.</p> <p>With the eyes of the world on him, Andross prepares for the Descent, a ceremony where he will unveil himself to the eyes of the world. But his existence isn't the only world-shaking event on the horizon. Inné, Marked one of the divine of war, will ascend in less than a year, and the invitation he extends to Andross isn’t one that the newest Marked can refuse.</p> <p>As the powers that be await with bated breath to see what Andross’ next move will be, Inné’s Ascension looms on the horizon, and it threatens to bring down the entire world in its wake.</p> <p>Book 5 of an Isekai LitRPG Adventure about an unexpected hero coming of age in his new home, progressing in power and abilities as he unlocks the secrets of magic and a System that may not be as trustworthy as it seems.</p>"; 
